import './App.css';
import React from 'react'
import Navbar from './myComponent/Navbar';
import News from './myComponent/News';
import Footer from './myComponent/Footer';
import { BrowserRouter as Router,Switch, Route} from "react-router-dom";

const App=()=> {

    return (


         <div>
       <Router>
        <Navbar/>

        <Switch>
          <Route exact path="/"><News key="general" size={6} country="in" category="general"/></Route> 
          <Route exact path="/business"><News key="business" size={6} country="in" category="business"/></Route> 
          <Route exact path="/General"><News key="General" size={6} country="in" category="General"/></Route> 
          <Route exact path="/health"><News key="health" size={6} country="in" category="health"/></Route> 
          <Route exact path="/science"><News key="science" size={6} country="in" category="science"/></Route> 
          <Route exact path="/sports"><News key="sports" size={6} country="in" category="sports"/></Route> 
          <Route exact path="/entertainment"><News key="entertainment" size={6} country="in" category="entertainment"/></Route> 
          <Route exact path="/technology"><News key="technology" size={6} country="in" category="technology"/></Route> 
        </Switch>

        <Footer/>
        </Router>


      </div>



    )

}
export default App;
